import React, {Component} from 'react'

class Item extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="card">
                <div className="card-header">{this.props.item.title}</div>
                <div className="card-body float-right">{this.props.item.cost} Руб.</div>
            </div>
        )
    }
}

export default Item
